var tipuesearch = {"pages": [{'title': 'cute cat', 'text': '\xa0\xa0', 'tags': '', 'url': 'cute cat.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n \n 虎科之光 \n', 'tags': '', 'url': 'About.html'}, {'title': 'W6', 'text': 'portable obs\xa0 \xa0 \xa0 google hangouts meet \n streaming and recording\xa0\xa0 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Teacher No.1', 'text': '\n I am a good boy please give me a higher point thanks \n', 'tags': '', 'url': 'Teacher No.1.html'}, {'title': '網際網路', 'text': '網際網路 （英語： Internet ）是指 20世紀 末期興起 電腦網路 與電腦網路之間所串連成的龐大 網路 系統。這些網路以一些標準的 網路協定 相連。它是由從地方到全球範圍內幾百萬個私人、 學術界 、企業和政府的網路所構成，透過 電子 ， 無線 和 光纖網路技術 等等一系列廣泛的技術聯繫在一起。網際網路承載範圍廣泛的資訊資源和服務，例如相互關聯的 超文字 檔案，還有 全球資訊網 （ WWW ）的應用， 電子郵件 ， 通話 ，以及 檔案分享 服務。 \n 網際網路的起源可以追溯到1960年代 美國聯邦政府 委託進行的一項研究，目的是建立容錯與電腦網路的通信。網際網路的前身 ARPANET 最初在1980年代作為區域學術和軍事網路連接的骨幹。1980年代， NSFNET 成為新的骨幹而得到資助，以及其他商業化擴展得到了私人資助，導致了全世界網路技術的發展，以及許多網路的合併。到1990年代初，商業網路和企業之間的連接標誌著向現代網際網路的過渡。儘管網際網路在1980年代被學術界廣泛使用 ， 但商業化的服務和技術融入了現代每個人的生活 。 \n', 'tags': '', 'url': '網際網路.html'}, {'title': 'IPv6', 'text': '網際協定第6版 （英語： I nternet \xa0 P rotocol \xa0 v ersion \xa0 6 ，縮寫： IPv6 ）是 網際協定 的最新版本，用作 網際網路 的 網路層 協定。用它來取代 IPv4 主要是為了解決 IPv4位址枯竭問題 ，同時它也在其他方面對於IPv4有許多改進。 \n IPv6的設計目的是取代IPv4，然而長期以來IPv4在網際網路流量中仍占據主要地位，IPv6的使用增長緩慢。在2019年12月，通過IPv6使用 Google 服務的用戶百分率首次超過30%。 \n', 'tags': '', 'url': 'IPv6.html'}, {'title': 'IPv4', 'text': '網際協定版本4 （英語： I nternet \xa0 P rotocol \xa0 v ersion \xa0 4 ，縮寫： IPv4 ，又稱 網際網路通訊協定第四版 ）是 網際協定 開發過程中的第四個修訂版本，也是此協定第一個被廣泛部署和使用的版本。其後繼版本為 IPv6 ，直到2011年， IANA \xa0 IPv4位元址完全用盡時，IPv6仍處在部署的初期。 \n IPv4在 IETF 於1981年9月發布的 \xa0 RFC 791 \xa0 中被描述，此RFC替換了於1980年1月發布的 \xa0 RFC 760 。 \n IPv4是一種 無連接 的協定，操作在使用 封包交換 的連結層（如 乙太網路 ）上。此協定會盡最大努力交付封包，意即它不保證任何封包均能送達目的地，也不保證所有封包均按照正確的順序無重複地到達。這些方面是由上層的傳輸協定（如 傳輸控制協定 ）處理的。 \n', 'tags': '', 'url': 'IPv4.html'}, {'title': 'Proxy', 'text': '代理 （英語： Proxy ）也稱 網路代理 ，是一種特殊的網路服務，允許一個 網路終端 （一般為 客戶端 ）通過這個服務與另一個 網路終端 （一般為 伺服器 ）進行非直接的連接。一些 閘道器 、 路由器 等網路裝置具備網路代理功能。一般認為代理服務有利於保障網路終端的隱私或安全，防止攻擊。 \n 提供代理服務的電腦系統或其它類型的網路終端稱為代理伺服器（英文：Proxy Server）。一個完整的代理請求過程為： 客戶端 首先與代理伺服器建立連接，接著根據代理伺服器所使用的代理協定，請求對目標伺服器建立連接、或者獲得目標伺服器的指定資源（如：檔案）。在後一種情況中，代理伺服器可能對目標伺服器的資源下載至本地 快取 ，如果客戶端所要取得的資源在代理伺服器的快取之中，則代理伺服器並不會向目標伺服器傳送請求，而是直接傳回已快取的資源。一些代理協定允許代理伺服器改變客戶端的原始請求、目標伺服器的原始回應，以滿足代理協定的需要。代理伺服器的選項和設定在電腦程式中，通常包括一個「防火牆」，允許用戶輸入代理位址，它會遮蓋他們的網路活動，可以允許繞過網際網路過濾實現網路存取。 \n 代理伺服器的基本行為就是接收客戶端傳送的請求後轉發給其他伺服器。代理不改變請求 URI ，會直接傳送給前方持有資源的目標伺服器。 \n 持有資源實體的伺服器被稱為 源伺服器 。從源伺服器返回的回應經過代理伺服器後再傳給客戶端。 \n', 'tags': '', 'url': 'Proxy.html'}, {'title': 'NAT', 'text': '網路位址轉換 （英語： N etwork \xa0 A ddress \xa0 T ranslation ，縮寫： NAT ；又稱 網路掩蔽 、 IP 掩蔽 ）在 計算機網路 中是一種在 IP 封包 通過 路由器 或 防火牆 時重寫來源 IP地址 或目的 IP 位址的技術。這種技術被普遍使用在有多台主機但只通過一個公有IP位址存取 網際網路 的 私有網路 中。它是一個方便且得到了廣泛應用的技術。當然， NAT 也讓主機之間的通信變得複雜，導致了通信效率的降低。 \n', 'tags': '', 'url': 'NAT.html'}, {'title': 'DHCP', 'text': '由於 IP 位址不夠，為了節省子網路中 IP 位址的使用量，可以設定網路中的一台主機做為指揮中心，稱為「動態主機組態協定伺服器（DHCP server）」或「DHCP 伺服器」。負責動態分配 IP 位址，當網路中有任何一台電腦要連線時，才向 DHCP 伺服器要求一個 IP 位址， DHCP 伺服器會從資料庫中找出一個目前尚未被使用的 IP 位址提供給該電腦使用，使用完畢後電腦再將這個 IP 位址還給 DHCP 伺服器，提供給其他上線的電腦使用。 \n 「動態主機組態協定（Dynamic Host Configuration Protocol, DHCP）」主要的功能是提供用戶端電腦動態的 IP 位址、子網路遮罩（Subnet mask）、預設閘道器（Default gateway）、DNS 伺服器的 IP 位址等，可以減少用戶端手動設定 IP 位址的麻煩，並且減少手動設定發生錯誤的機率，又可以節省 IP 位址的使用量。 \n', 'tags': '', 'url': 'DHCP.html'}]};